import React from 'react';
import Card from './Card';
import {robots} from './robots';

const CardList = () => {
    return (
        <div className="container">
            <Card id={robots[0].id} name={robots[0].name} email={robots[0].email} imgUrl={robots[0].imgUrl}/>
            <Card id={robots[1].id} name={robots[1].name} email={robots[1].email} imgUrl={robots[1].imgUrl}/>
            <Card id={robots[2].id} name={robots[2].name} email={robots[2].email} imgUrl={robots[2].imgUrl}/>
        </div>
    );
}

export default CardList;
